import React from 'react';


const PageError = (props) => {

    <div className="PageError"><h1></h1>{/* {props.error.message} */}</div>;
  <style>{`
  .PageError {
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    min-height: 100vh;
    width: 100%;
  }
  `}</style>
    
}

export default PageError;
